    unSelectedListLoad() {
        this.items.forEach((/**
         * @param {?} item
         * @return {?}
         */
        item => {
            item.inFavorites = false;
            item.checked = false;
            if (this._isInArray(item[this.idField], this.idField, this.favoritesList) !== -1) {
                item.inFavorites = true;
            }
            if (this._isInArray(item[this.idField], this.idField, this.selections) !== -1) {
                item.checked = true;
            }
            item.displayName = !!this.showUserCode ? ('[' + item.code + ']' + item.name) : item.name;
            if (this.showOrgAllPathByDesc && item.orgAllPath) {
                item.orgAllPath = this.changeDisplayOrgAllPath(item.orgAllPath);
            }
        }));
        this.items = this.items.slice();
        this.pageChangeCheck();
        this.cd.detectChanges();
    }
    /**
     * 选中并插入当前行数据到右侧
     * @param {?} data 当前行的数据
     * @return {?}
     */
    _insertOneIntoSelections(data) {
        // 如果当前数据已经移入右侧数据，则返回。
        if (this._isInArray(data[this.idField], this.idField, this.selections) > -1) {
            return;
        }
        this.selections.push(data);
        this.selections = this.selections.slice();
    }
    /**
     * 判断是否在内
     * @param {?} value value
     * @param {?} field field
     * @param {?} array array
     * @return {?} 位置索引
     */
    _isInArray(value, field, array) {
        if (!field || !value) {
            throw new Error('前2个参数必填');
        }
        return array.findIndex((/**
         * @param {?} item
         * @return {?}
         */
        item => value === item[field]));
    }
    /**
     * 翻页检查：人员展示区的勾选状态与已选人员区是否对应
     * @return {?}
     */
    pageChangeCheck() {
        /** @type {?} */
        const checkeds = this.items.filter((/**
         * @param {?} item
         * @return {?}
         */
        item => item.checked));
        if (this.items.length !== 0 && this.items.length === checkeds.length) {
            this.allChecked = true;
        }
    }
    /**
     * @private
     * @param {?} data
     * @return {?}
     */
    changeDisplayOrgAllPath(data) {
        if (!data) {
            return '';
        }
        /** @type {?} */
        const orgAllPathArray = data.split('_');
        return orgAllPathArray.reverse().join('_');
    }
